  false,\n\t\"url\": null,\n\t\"notes\": \"In 2011 Aldaron Laird walked and kayaked
  the entire shoreline of Humboldt Bay mapping the shoreline conditions onto 11x17
  laminated fieldmaps at a scale of 1' = 200' using 2009 orthophotos as an imagery
  backdrop. He classified the shoreline as Natural vs Artificial, noted the structure
  type, cover type, and if there was salt marsh habitat adjacent to it. The bay was
  broken up into six areas as Arcata Bay, Mad River Slough, Eureka Slough, Eureka
  Bay, Elk River Slough, and South Bay.\",\n\t\"owner_org\": \"467d900f-8a42-452d-9906-6610dd1a767f\",\n\t\"extras\":
